        info_tnc_ad_title: "বিরোধ নিষ্পত্তি",
        info_tnc_ad_desc:
          "আমাদের এবং আপনার মধ্যে কোনও বিরোধ দেখা দিলে, আমরা প্রত্যেকে     সময়ে সময়ে সংশোধিত হিসাবে আমাদের বিরোধ নিষ্পত্তি নীতিতে  নির্ধারিত পদ্ধতি অনুসরণ  করতে সম্মত হই  ।",
