        info_tnc_af_title: "কোন ছাড় নেই",
        info_tnc_af_desc:
          " এই চুক্তির অধীন কোন  পক্ষ কর্তৃক তার     কোন অধিকার প্রয়োগে  কোন ব্যর্থতা বা বিলম্ব উহার মওকুফ হিসাবে কাজ করবে না এবং এই ধরনের কোন অধিকারের একক বা আংশিক প্রয়োগ উক্ত বা অন্য কোন অধিকারের অন্য কোন বা পরবর্তী প্রয়োগকে বাধা গ্রস্ত করবে না। ",
        info_responsibleGaming: "দায়িত্বশীল গেমিং",
        info_responsibleGaming_a_title: "দায়িত্বশীলভাবে খেলুন",
        info_responsibleGaming_a_desc:
          "LuckyBangla88 এ খেলা সক্রিয় এবং মজাদার হওয়া উচিত, পাশাপাশি উদ্দীপক এবং মজাদার হওয়া উচিত। কখনও কখনও আমরা কতটা জুয়া খেলতে চাই তা নিয়ন্ত্রণ করা কঠিন; আমরা কতটা হারাতে পারি তার সাথে এর সম্পর্ক রয়েছে। এই বিভাগে, আপনি আপনার গেমের নিয়ন্ত্রণ নিতে আপনাকে সহায়তা করার উপায়গুলি খুঁজে পাবেন এবং আপনি যদি মনে করেন যে আপনার সাহায্যের প্রয়োজন হতে পারে তবে আপনাকে কোথায় যেতে হবে তা আপনাকে দেখাবেন।",
        info_responsibleGaming_b_title: "আমার মনে হয় আমি হয়তো খুব বেশি খেলি",
        info_responsibleGaming_b_desc:
          'নীচে আমরা একটি সুপরিচিত মনোবিজ্ঞান অধ্যয়ন থেকে একটি বিবৃতি তালিকাভুক্ত করি। আপনি যদি মনে করেন যে এই বিবৃতিগুলির এক বা একাধিক আপনার জন্য প্রযোজ্য, আপনার একটি গেমিং সমস্যা থাকতে পারে এবং আমরা আপনাকে পেশাদার সহায়তা নেওয়ার পরামর্শ দিই এবং অংশ 3 এবং 4 এ বাবু 88 কীভাবে আপনাকে এই সমস্যার সাথে সহায়তা করতে পারে তা দেখুন। আপনি সফলতা ছাড়াই একাধিকবার খেলা নিয়ন্ত্রণ, হ্রাস বা বন্ধ করার চেষ্টা করেছেন।\nধীর গতিতে বা খেলা বন্ধ করার চেষ্টা করার সময় অস্থির বা খিটখিটে বোধ করা। আপনি সমস্যা এড়াতে বা বিরক্ত আবেগ মুক্ত করার উপায় হিসাবে খেলেন।\nআপনি প্রায়শই প্রতিশোধ নেওয়ার জন্য একটি গেম হেরে যাওয়ার পরে অন্য দিন ফিরে আসেন (আপনার ক্ষতি "শিকার করুন")। আপনি জুয়ায় আপনার জড়িত তা আড়াল করার জন্য পরিবারের সদস্য, থেরাপিস্ট বা অন্যদের কাছে মিথ্যা বলেছিলেন।\nআপনি গেমসের অর্থায়নের জন্য অবৈধ জালিয়াতি, জালিয়াতি, চুরি বা আত্মসাৎ করেছেন। আপনি জুয়া খেলার কারণে একটি গুরুত্বপূর্ণ সম্পর্ক, চাকরি, শিক্ষা বা ক্যারিয়ারের সুযোগ বিপন্ন বা হারিয়েছেন।\nজুয়া খেলার কারণে সৃষ্ট মরিয়া আর্থিক পরিস্থিতি সহজ করার উপায় সরবরাহ করার জন্য আপনি অন্যদের উপর নির্ভর করেন।\n',
