          "हम  , अपने विवेक पर, नोटिस  पर किसी भी समय, कारण  के साथ या बिना कारण के  आपके खाते  को  निलंबित या समाप्त कर सकते हैं।   आप किसी भी समय अपना खाता  समाप्त कर सकते हैं। \nबस हमारी ग्राहक सेवा से संपर्क करें यदि आप ऐसा करना चाहते हैं।\n यदि आप हमारे कानूनी अधिकार क्षेत्र के बाहर के क्षेत्रों में काम करते हुए पाए जाते हैं तो हम  आपको सट्टेबाजी या हमारी सेवाओं का उपयोग करने  से रोक सकते हैं।\nहम आपके खाते के संबंध में किसी भी संदिग्ध गतिविधियों पर जांच करने का अधिकार सुरक्षित रखते हैं। किसी भी जांच के निर्धारण पर, हम आपके खाते में कुछ या सभी धन को जब्त करने का अधिकार सुरक्षित रखते हैं यदि आप नियम और शर्तों के किसी भी प्रावधान का उल्लंघन करते हुए पाए जाते हैं। यदि इसकी आवश्यकता होती है, तो हम  आपके खाते को तुरंत निलंबित कर सकते हैं।\n",
