        info_tnc_k_title: "सट्टेबाजी\nसामान्य शर्तें",
        info_tnc_k_desc:
          'बाबू 88  एक मंच प्रदान करता है जहां खिलाड़ी हमारी  साइटों पर उपलब्ध बाजारों के संबंध में विभिन्न सट्टेबाजी लेनदेन में प्रवेश  कर सकते हैं।\nजहां खिलाड़ी हमारी सेवाओं का उपयोग करने पर दांव लगाते हैं, बाबू 88 एक सुविधा प्रदाता के रूप में कार्य करता है और  एक प्रतिपक्ष के रूप में कार्य नहीं करता है।\n \nआप हमारी  वेबसाइट के माध्यम से या  हमारे मोबाइल एप्लिकेशन के माध्यम से सट्टेबाजी लेनदेन में प्रवेश कर   सकते हैं; \n\nइन सामान्य शर्तों में जब हम "सेवाओं" का उल्लेख करते हैं तो हमारा मतलब ऊपर सूचीबद्ध सभी सेवाओं (जहां लागू हो) से है।\nइन सामान्य शर्तों में "बाबू 88", "हम", "हम" और / या "हमारे" उन सभी को संदर्भित करते हैं जो बाबू आपको विशिष्ट में निर्धारित सेवाओं को प्रदान कर रहे हैं।\nशर्तें आपके सट्टेबाजी लेनदेन पर लागू होती हैं।\nकृपया किसी भी सट्टेबाजी लेनदेन में प्रवेश करने से पहले इन सामान्य शर्तों और आपके और आपके सट्टेबाजी लेनदेन पर लागू विशिष्ट शर्तों को ध्यान से पढ़ें।\nकृपया ध्यान दें कि हमारे प्रत्येक विनिमय और उत्पादों के लिए अलग-अलग नियम और विनियम हैं। बाजारों की पेशकश, प्रबंधन और / या निपटान को नियंत्रित करने वाले नियम प्रत्येक उत्पाद पर हर बाजार के लिए समान नहीं हैं। कुछ परिस्थितियों में, एक शर्त जो एक उत्पाद पर विजेता के रूप में तय की जाती है, उसे दूसरे उत्पाद पर हारने वाले के रूप में निपटाया जा सकता है (और इसके विपरीत)। इसके अतिरिक्त, विभिन्न निपटान नियम लागू हो सकते हैं ताकि, उदाहरण के लिए, एक उत्पाद पर विजेता दांव को मृत गर्मी के रूप में निपटाया जा सकता है या दूसरे उत्पाद पर शून्य किया जा सकता है। उपयोगकर्ताओं को यह सुनिश्चित करना होगा कि वे बाबू 88 पर लगाए गए दांव पर लागू होने वाले प्रासंगिक नियमों से खुद को परिचित करें।\nयदि उल्लिखित दस्तावेजों, इस दस्तावेज़ और प्रासंगिक विशिष्ट शर्तों के बीच कोई विसंगतियां हैं, तो विशिष्ट शर्तें  इस दस्तावेज़ पर प्रबल होंगी,  और यह दस्तावेज़ ऊपर सूचीबद्ध   दस्तावेज़ों पर  प्रबल  होगा।',
